        var trackLocation = function(success, failure) {
          var self = this;
          var location = null;

          // function to get user location
          function getLocation() {
            if (navigator.geolocation) {
              navigator.geolocation.getCurrentPosition(function(position) {
                location = {
                  lat: position.coords.latitude,
                  lon: position.coords.longitude
                };
                // do something with the location data
                success(location);
              }, function(error) {
                failure(error);
              });
            } else {
              failure("Geolocation is not supported");
            }
          }

          // call the getLocation function when the button is clicked
          document.getElementById("track").addEventListener("click", getLocation);
        }

        // Add a button to track the user's location
        var trackButton = document.getElementById("track");
        trackButton.addEventListener("click", trackLocation);
